import React, { useState, useEffect}  from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import NumericInput from 'react-numeric-input';
import Container from 'react-bootstrap/Container';
import Request from './Request'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
function Fortune() {
	let y = 1;
	const [fortune, setFortune] = useState("");
	const [checkedA, setCheckedA] = useState(false);
	const [checkedC, setCheckedC] = useState(false);
	const [checkedF, setCheckedF] = useState(false);
	const [checkedE, setCheckedE] = useState(false);
	const [checkedL, setCheckedL] = useState(false);
	const [checkedO, setCheckedO] = useState(false);
	const [checkedS, setCheckedS] = useState(false);
	const [checkedI, setCheckedI] = useState(false);
	const [checkedU, setCheckedU] = useState(false);
	const [checkedM, setCheckedM] = useState("");
	const [checkedN, setCheckedN] = useState(1);
	const [checkedPercent, setCheckedPercent] = useState({} as Record<string, string>);
	const api = new Request("http://gopiko.fr/");

	useEffect(() => {
		if (y)
  			getFortune();
		y = 0;
	}, []);

	function getFortune () {
		api.Post("/fortune", {
			A: checkedA,
			C: checkedC,
			E: checkedE,
			F: checkedF,
			L: checkedL,
			O: checkedO,
			S: checkedS,
			I: checkedI,
			U: checkedU,

		}).then((resp: any) => {
			setFortune(resp.data.StdoutResponse)
		});		
	};

return (
	<div>
		<Container fluid><p>{fortune}</p></Container>
		<Container fluid>
<Row>
<Col>
			<Form.Check 
				type={"checkbox"}
				onChange={(e)=>{setCheckedA(e.target.checked)}}
        			checked={checkedA}
          		/>
</Col>
<Col>
<Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedC(e.target.checked)}}
        			checked={checkedC}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedE(e.target.checked)}}
        			checked={checkedE}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedF(e.target.checked)}}
        			checked={checkedF}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedL(e.target.checked)}}
        			checked={checkedL}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedO(e.target.checked)}}
        			checked={checkedO}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedD(e.target.checked)}}
        			checked={checkedS}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedI(e.target.checked)}}
        			checked={checkedI}
          		/></Col>
<Col><Form.Check
				type={"checkbox"}
				onChange={(e)=>{setCheckedAU(e.target.checked)}}
        			checked={checkedU}
          		/></Col>
</Row>
<Form.Control type="texte" placeholder="Enter email" />
<NumericInput
					className="form-control"
					id="c-input"
					min={1} value={checkedN}
					onChange={(e)=>{if (e && e >= 1) setCheckedN(e);}}
				/>
			<button onClick={getFortune}>Get Fortune</button>;
		</Container>
	</div>
	)
}

export default Fortune;
